import React, { Component } from "react";

export default class Grid extends Component {
  render() {
    const styles = {
      border: "2px solid darkblue",
      height: "50px",
      marginTop: "100px"
    };

    return (
      <div class="container">
        <div class="row">
          <div style={styles} class="col-sm">
            <h1>1.</h1>
          </div>
          <div style={styles} class="col-sm">
            <h1>2.</h1>
          </div>
          <div style={styles} class="col-sm">
            <h1>3.</h1>
          </div>
          <div style={styles} class="col-sm">
            <h1>4.</h1>
          </div>
        </div>
      </div>
    );
  }
}
